int null_docs = 0;
for(tile in params._source.tiles){
    if(tile.nodegroup_id == params.nodegroup_id ){
        def val = tile.data.get(params.node_id);
        if (val == null || val == "" || (val instanceof List && val.length==0)) {
            null_docs++;
            break;
        }
    }
}
return null_docs;
